import React, { useState } from 'react';

const Booking = () => {
  const [formData, setFormData] = useState({
    user_id: '',
    show_id: '',
    seats_booked: '',
  });
  const [response, setResponse] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setResponse(null);

    try {
      const res = await fetch('/api/bookings', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          user_id: parseInt(formData.user_id),
          show_id: parseInt(formData.show_id),
          seats_booked: parseInt(formData.seats_booked),
        }),
      });

      const data = await res.json();

      if (!res.ok) {
        throw new Error(data.error || 'Failed to create booking');
      }

      setResponse(data);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="max-w-md mx-auto p-6 bg-white shadow-md rounded-lg mt-8">
      <h2 className="text-2xl font-bold mb-6 text-center">Create Booking</h2>
      
      <div className="space-y-4">
        <div>
          <label htmlFor="user_id" className="block text-sm font-medium text-gray-700">
            User ID
          </label>
          <input
            type="number"
            id="user_id"
            name="user_id"
            value={formData.user_id}
            onChange={handleChange}
            className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-indigo-500 focus:border-indigo-500"
            required
          />
        </div>

        <div>
          <label htmlFor="show_id" className="block text-sm font-medium text-gray-700">
            Show ID
          </label>
          <input
            type="number"
            id="show_id"
            name="show_id"
            value={formData.show_id}
            onChange={handleChange}
            className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-indigo-500 focus:border-indigo-500"
            required
          />
        </div>

        <div>
          <label htmlFor="seats_booked" className="block text-sm font-medium text-gray-700">
            Number of Seats
          </label>
          <input
            type="number"
            id="seats_booked"
            name="seats_booked"
            value={formData.seats_booked}
            onChange={handleChange}
            min="1"
            className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-indigo-500 focus:border-indigo-500"
            required
          />
        </div>

        <button
          type="button"
          onClick={handleSubmit}
          disabled={loading}
          className="w-full bg-indigo-600 text-white py-2 px-4 rounded-md hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-500 disabled:bg-indigo-300"
        >
          {loading ? 'Submitting...' : 'Create Booking'}
        </button>
      </div>

      {error && (
        <div className="mt-4 p-3 bg-red-100 text-red-700 rounded-md">
          {error}
        </div>
      )}

      {response && (
        <div className="mt-4 p-3 bg-green-100 text-green-700 rounded-md">
          <h3 className="font-semibold">Booking Confirmed!</h3>
          <p>Booking ID: {response.booking_id}</p>
          <p>Booking Code: {response.booking_code}</p>
          <p>Seats Booked: {response.seats_booked}</p>
          <p>Total Amount: ${response.total_amount}</p>
          <p>Status: {response.status}</p>
        </div>
      )}
    </div>
  );
};

export default Booking;
